job_description:
Corporate Human Resources Kompas Gramedia (also known as Growth Center Kompas Gramedia) is looking for Learning  Intern. The intern will be working in the Kognisi project, our online learning platform both for internal Kompas Gramedia employees and external client partners, in managing learning platform database and its data analytics.
,
,Responsibilities:,
Manage the database and conduct analysis using the learning data in the platform periodically;
,
Provide the performance report of every contents available in the platform periodically;
,
Conduct research related to learning needs and performance insights from the executed learning initiatives.
,Strong data analytical skill;
,
Previous experience conducting research;
,
Exposure to project management skills and experiences.
